                        <div class="bio-text">
                            <p>Dr. Firdaus Hariri is a Professor and senior consultant in oral maxillofacial surgery at University of Malaya Medical Centre (UMMC), Department of Oral and Maxillofacial Clinical Sciences, Faculty of Dentistry Universiti Malaya and University of Malaya Specialist Centre. He obtained both his dental and medical degrees from Universiti Malaya (UM) and completed his oral and maxillofacial surgery training with distinction at Queen Mary Hospital and Prince Philip Dental Hospital, The University of Hong Kong (HKU). He later had his craniofacial attachments at various established craniofacial centres abroad and also obtained his Master of Science in Molecular Medicine from International Medical University (IMU). In addition to routine maxillofacial surgical practices such as orthognathic surgery, trauma and oral implantology, his subspecialty and research interests are focused on pediatric craniofacial and reconstructive surgery, tissue engineering in particular distraction osteogenesis technique, bone regeneration for oral rehabilitation and the field of neurotrauma. He has more than 50 academic publications and is actively involved in national and international scientific conferences, consultations and organizations. He is one of the founding members and currently the coordinator for the multidisciplinary craniofacial clinic in UMMC, the team leader for Oro-Craniomaxillofacial Research and Surgical (OCReS) group at the Faculty of Dentistry UM, subspecialty coordinator for the Fellowship in Advanced Craniomaxillofacial Surgery UM, the chairman of National Dental Specialty Education Committee (DentSEdC) for oral and maxillofacial surgery as well as part of the editorial board for Malaysian Journal of Oral and Maxillofacial Surgeons. He is passionate in music, social enterprise and humanitarian activities. Among the significant contributions in these areas are the success of Voices of Hope Charity Concert, collaboration with University of Malaya Industry and Community Engagement (ICE) office for the social enterprise initiative among single parents in marginalized community and successfully initiating the nation-wide aerosol box fabrication and distribution during COVID-19 pandemic in 2020.</p>
