                        <div class="bio-text">
                            <p>Wan Marhaini Wan Ahmad is an Associate Professor at the Department of Finance, Faculty of Business and Economics, Universiti Malaya, Malaysia. She has been a member of the Shariah Advisory Board for a few local Islamic financial and corporate institutions (Zurich General Takaful Malaysia Berhad and Zurich Takaful Malaysia Berhad since 2020, UOB Malaysia Nerhad since 2021 and Xeraya Capital Sendirian Berhad since 2014). Prior to this, she served as a Shariah Committee member for Bank Muamalat Malaysia Berhad (2012-2019) and EonCap Islamic Bank Berhad (2011 till 2012). She is also a registered Shariah Advisor for the Malaysian Islamic Capital Market.
She has received secondary school education from Maahad Muhammadi lil Banat in Kelantan and obtained her Bachelor of Syariah (Hon.) from the University of Malaya, Kuala Lumpur. Further, she acquired her Master in Economics from the International Islamic University Malaysia and a doctoral degree in Islamic Finance from the University of Edinburgh, Scotland.
Her main research interest is Islamic finance, waqf, zakat and personal finance behaviour. She has written, reviewed and edited articles and books as well as has more than a decade of experiences teaching and supervising students &rsquo;works in these areas.</p>
